import axios from "axios";
const headers = {
  "Content-Type": "application/json"
};
const urlBack = "http://localhost:4000";

export default {
    companies: async(str)=>{
        const requestOptions = {
            method: 'POST',
            headers: headers,
            body: str
        };

       
        const response = await  fetch(urlBack+"/companies", requestOptions)
        const data = await response.json();
        console.log(data)
          
        //return response
    }
};
